import React, { Component } from 'react'

export class BoxRender extends Component {
    constructor(props) {
        super(props)
    }
    render() {
        return (
            <div className="col-lg-6 p-t-20">
                    <div className="mdl-textfield mdl-js-textfield mdl-textfield--floating-label getmdl-select getmdl-select__fix-height txt-full-width">
                    <label
                        htmlFor="SelectBox1"
                        className="mdl-textfield__label"
                      >
                        Department
                      </label>
                      <select  className="mdl-textfield__input">
                         {this.props.children}
         </select>
                    </div>
                  </div>
        )
    }
}

export default BoxRender
